import axios from 'axios';

const baseurl ='http://localhost:3000/home'
const AxiosInstance = axios.create({
    baseURL: baseurl,
    timeout:50000,
    headers: {
        "Content-Type": "application/json",
        accept:"application/json"
    }
})
export default AxiosInstance;
